import { Link } from "react-router-dom"

function AniForm(props) {


    return (  
        <div>
            <Link to={props}>
                <div className="anime-block">
                    <img src={props} alt="" />
                    <p className="anime-name">{props}</p>
                </div>
            </Link>
        </div>
    );
}

export default AniForm;
